sys_variable_value.value:
(function execute(inputs, outputs) {
    var refresh_token = '3477bbdcf574d618b0c271aa79e47a0e6a854d48';
    var clientID = '43919';
    var clientSecret = '9354079ebcc7b64fec4e6f0198ee79a3f96782dc';

    // Construct the request body
    var requestBody = 'client_id=' + clientID +
                      '&client_secret=' + clientSecret +
                      '&refresh_token=' + refresh_token +
                      '&grant_type=refresh_token';

    // Create a REST message
    var restMessage = new sn_ws.RESTMessageV2();
    restMessage.setHttpMethod('POST');
    restMessage.setEndpoint('https://www.strava.com/oauth/token');
    restMessage.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');

    // Set the constructed request body
    restMessage.setRequestBody(requestBody);

    // Execute the REST message
    var response = restMessage.execute();

    var responseBody = response.getBody();
    var httpStatus = response.getStatusCode();

    if (httpStatus === 200) {
        gs.info('Success! Response Body: ' + responseBody); // Log the response body on success
        
        // Additional logging for debugging
        gs.info('TokenString before assignment: ' + outputs.TokenString); // Log the TokenString before assignment
        outputs.TokenString = responseBody; // Assign responseBody to TokenString output variable
        gs.info('TokenString after assignment: ' + outputs.TokenString); // Log the TokenString after assignment
    } else {
        gs.error('Error: ' + httpStatus + ' - ' + responseBody); // Log error details
        outputs.TokenString = null; // Or handle the error case accordingly
    }
})(inputs, outputs);

